import React, { Component } from "react";
import "./App.css";
import Home from "./component/home";
import { BrowserRouter as Route, Router } from "react-router-dom";
class App extends Component {
  render() {
    return (
      <Router>
        <div>
          <Route path="/" exact={true} component={Home} />
        </div>
      </Router>
    );
  }
}

export default App;
